import React from 'react';
import Header from '../components/Header';

export default function FavoriteRecipes() {
  return (
    <div>
      <Header search="false" title="Favorite Recipes" />

      <button
        type="button"
        data-testid="filter-by-all-btn"
      >
        All
      </button>
    </div>
  );
}
